import { Link } from 'react-router-dom';
function Navigation(isLogged) {
  return (
    <nav className="navigation">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/saved-news">Saved articles</Link>  
        </li>
        <li>
          <button>{isLogged ? "Elise" : "Sign in"}</button>  
        </li>           
      </ul>  
        
        
    </nav>
  );
}

export default Navigation;
